[{"location":"quickguide/#Quick-Start-Guide","page":"Quick Start Guide","title":"Quick Start Guide","text":"","category":"section"},{"location":"quickguide/","page":"Quick Start Guide","title":"Quick Start Guide","text":"Once PowerModelsDSSE is installed, together with its dependencies, install Ipopt and SCS. These are needed to solve non-convex and convex problems, respectively. To run a simulation, a network data file (e.g. \"case3_unbalanced.dss\" in the package folder under /test/data/opendss) needs to be acquired, together with its relative measurement file (e.g. \"case3_input.csv\" in the package folder under /test/data/). Network and measurement data will be merged and a SE example can be run as follow:","category":"page"},{"location":"quickguide/","page":"Quick Start Guide","title":"Quick Start Guide","text":"using PowerModelsDSSE, PowerModelsDistribution\r\nusing Ipopt\r\n\r\n_PMD = PowerModelsDistribution\r\n\r\ndata = parse_file(\"test/data/opendss/case3_unbalanced.dss\")\r\npmd_data = _PMD.transform_data_model(data)\r\nmeas_file = \"test/data/case3_input.csv\"\r\nadd_measurement_to_pmd_data!(pmd_data, meas_file; actual_meas=false, seed=0)\r\nadd_measurement_id_to_load!(pmd_data, meas_file)\r\npmd_data[\"setting\"] = Dict{String,Any}(\"estimation_criterion\" => \"wls\",\r\n                                        \"rescale_weight\" => 1)\r\n\r\nse_result = run_ivr_mc_se(pmd_data, optimizer_with_attributes(Ipopt.Optimizer, \"tol\"=>1e-6, \"print_level\"=>0))","category":"page"},{"location":"quickguide/","page":"Quick Start Guide","title":"Quick Start Guide","text":"The run commands return detailed results data in the form of a dictionary, following PowerModelsDistribution format, and can be saved for further processing, as above.","category":"page"},{"location":"quickguide/#Accessing-Different-Formulations","page":"Quick Start Guide","title":"Accessing Different Formulations","text":"","category":"section"},{"location":"quickguide/","page":"Quick Start Guide","title":"Quick Start Guide","text":"To different formulations correspond different run functions. The function \"runacpmcse\" uses the AC Polar form, \"runacrmcse\" uses the AC rectangular, etc.","category":"page"},{"location":"measurements_and_conversions/","page":"-","title":"-","text":"This section reports the allowed measured quantities, together with the expressions that convert them to a different variable space, if they are not native to the space of the formulation they are associated to.","category":"page"},{"location":"measurements_and_conversions/","page":"-","title":"-","text":"Table I: summary of allowed measured variables and conversions","category":"page"},{"location":"measurements_and_conversions/","page":"-","title":"-","text":"| | vm | va | cmx | cax | crx | cix | px | qx | vr | vi | |––-|––|––|––-|––-|––-|––-|––|––|––|––| | ACP | N  | N  | SF  | X  | F   | F   | N  | N  | X  | X  | | ACR | SF | PP | SF  | X  | MF  | MF  | N  | N  | N  | N  | | IVR | SF | PP | SF  | PP  | N   | N   | M  | M  | N  | N  |","category":"page"},{"location":"measurements_and_conversions/","page":"-","title":"-","text":"Where: <br /> N: no conversion needed (the variable is part of the formulation's space) <br /> X: not provided <br /> PP: conversion of type PreProcessing <br /> SF: conversion of type SquareFraction <br /> M: conversion of type Multiplication <br /> F: conversion of type Fraction <br /> MF: conversion of type MultiplicationFraction","category":"page"},{"location":"measurements_and_conversions/","page":"-","title":"-","text":"The x in cmx, cax, etc.. indicates that the conversion is valid for all the following component type: branch, gen and load, for which they would be written as cm, cmg (gen), cmd (load), ca, cag, cad, etc.","category":"page"},{"location":"measurements_and_conversions/","page":"-","title":"-","text":"Although they have been available, it is not advisable that the user relies on the AT conversions, as the optimizer might fail to identify the correct quadrant.","category":"page"},{"location":"measurements_and_conversions/","page":"-","title":"-","text":"A guess is made in the conversion type definition, to assign the measure to the most likely quadrant. However, this might change from system to system or if a system is rather unbalanced. This can lead to convergence issues or large errors on the estimation.","category":"page"},{"location":"measurements_and_conversions/","page":"-","title":"-","text":"In table 2 below, a description of the actual conversion formula is provided.","category":"page"},{"location":"measurements_and_conversions/","page":"-","title":"-","text":"| | vm | va | cmx | cax | crx | cix | px | qx | vr | vi | |––-|––|––|––-|––-|––-|––-|––|––|––|––| | ACP | N  | N  | cmx<sup>2</sup> = (px<sup>2</sup>+qx<sup>2</sup>)/vm<sup>2</sup>  | X  | crx = (px*cos(va)+qx*sin(va))/vm   | cix = (-qx *cos(va)+px*sin(va))/vm   | N  | N  | X  | X  | | ACR | vm<sup>2</sup> = (vi<sup>2</sup>+vr<sup>2</sup>)/1 | tan(va) = vi/vr | cmx<sup>2</sup> = (px<sup>2</sup>+qx<sup>2</sup>)/vm<sup>2</sup>  | X  | crx = (px*vr+qx*vi)/(vr<sup>2</sup>+vi<sup>2</sup>)  | cix = (px*vi-qx*vr)/(vr<sup>2</sup>+vi<sup>2</sup>)  | N  | N  | N  | N  | | IVR | vm<sup>2</sup> = (vi<sup>2</sup>+vr<sup>2</sup>)/1 | tan(va) = vi/vr | cmx<sup>2</sup> = (cix<sup>2</sup>+crx<sup>2</sup>)/1  | tan(cax) = cix/crx  | N   | N   | px = vr*crx+vi*cix  | qx = vi*crx-vr*cix  | N  | N  |","category":"page"},{"location":"formulation/","page":"-","title":"-","text":"variable_mc_residual\r\nconstraint_mc_residual\r\nobjective_mc_se","category":"page"},{"location":"formulation/#PowerModelsDSSE.variable_mc_residual","page":"-","title":"PowerModelsDSSE.variable_mc_residual","text":"variable_mc_residual\n\n\n\n\n\n","category":"function"},{"location":"formulation/#PowerModelsDSSE.objective_mc_se","page":"-","title":"PowerModelsDSSE.objective_mc_se","text":"objective_mc_se\n\n\n\n\n\n","category":"function"},{"location":"#PowerModelsDSSE.jl-Documentation","page":"PowerModelsDSSE.jl Documentation","title":"PowerModelsDSSE.jl Documentation","text":"","category":"section"},{"location":"","page":"PowerModelsDSSE.jl Documentation","title":"PowerModelsDSSE.jl Documentation","text":"PowerModelsDSSE.jl is an extention package of PowerModelsDistribution.jl for Static Distribution System State Estimation. A Distribution System State Estimator determines the most-likely state of distribution system given a set of uncertainties. These uncertainties may pertain to any quantity of any network component, e.g., :vm of a :bus, :pd of a :load, etc.","category":"page"},{"location":"","page":"PowerModelsDSSE.jl Documentation","title":"PowerModelsDSSE.jl Documentation","text":"Currently, uncertainties may either be described by:","category":"page"},{"location":"","page":"PowerModelsDSSE.jl Documentation","title":"PowerModelsDSSE.jl Documentation","text":"a nothing {Nothing},\na deterministic value {Float64}, or\na continuous univariate distribution {ContinuousUnivariateDistribution}:\na normal distribution, modeled through either wls or wlav approach, or\na non-normal distribution, modeled through -logpdf.","category":"page"},{"location":"#Notes","page":"PowerModelsDSSE.jl Documentation","title":"Notes","text":"","category":"section"},{"location":"","page":"PowerModelsDSSE.jl Documentation","title":"PowerModelsDSSE.jl Documentation","text":"Currently, bad data detection techniques and observability considerations are out of scope.","category":"page"},{"location":"#Core-Problem-Specification","page":"PowerModelsDSSE.jl Documentation","title":"Core Problem Specification","text":"","category":"section"},{"location":"","page":"PowerModelsDSSE.jl Documentation","title":"PowerModelsDSSE.jl Documentation","text":"State Estimation (SE), for the Bus Injection Model (BIM)","category":"page"},{"location":"#Core-Network-Formulations","page":"PowerModelsDSSE.jl Documentation","title":"Core Network Formulations","text":"","category":"section"},{"location":"","page":"PowerModelsDSSE.jl Documentation","title":"PowerModelsDSSE.jl Documentation","text":"AC (polar coordinates)","category":"page"},{"location":"#Network-Data-Formats","page":"PowerModelsDSSE.jl Documentation","title":"Network Data Formats","text":"","category":"section"},{"location":"","page":"PowerModelsDSSE.jl Documentation","title":"PowerModelsDSSE.jl Documentation","text":"OpenDSS \".dss\" files for grid and profile data\nCSV \".csv\" file with measurement a statistical information for state estimation","category":"page"},{"location":"#Summary-of-State-Estimation-Possibilities","page":"PowerModelsDSSE.jl Documentation","title":"Summary of State Estimation Possibilities","text":"","category":"section"},{"location":"","page":"PowerModelsDSSE.jl Documentation","title":"PowerModelsDSSE.jl Documentation","text":"| -  | SDP | VI | ACP | ACR | | –- | –- | | BF of BI | BF | BF | BI | BI | | Advanced SE | Unavailable | Unavailable | Available | Unavailable | | Simple SE | Available | Available | Available | Available | | 4-wire | v0.2.0 | v0.2.0 | v0.2.0 | v0.2.0 |","category":"page"},{"location":"","page":"PowerModelsDSSE.jl Documentation","title":"PowerModelsDSSE.jl Documentation","text":"BF indicates that the model is a branch flow model, BI that it is a bus injectino model. Simple SE does not include modeling of transformers and delta/wye loads, ...","category":"page"},{"location":"#Installation","page":"PowerModelsDSSE.jl Documentation","title":"Installation","text":"","category":"section"},{"location":"","page":"PowerModelsDSSE.jl Documentation","title":"PowerModelsDSSE.jl Documentation","text":"XXX","category":"page"},{"location":"#Acknowledgements","page":"PowerModelsDSSE.jl Documentation","title":"Acknowledgements","text":"","category":"section"},{"location":"","page":"PowerModelsDSSE.jl Documentation","title":"PowerModelsDSSE.jl Documentation","text":"This code has been developed as part of the Decision Support at the University of Leuven (KU Leuven) and EnergyVille. The primary developers are Tom Van Acker (@timmyfaraday) and Marta Vanin (@MartaVanin) with support for the following contributors:","category":"page"},{"location":"","page":"PowerModelsDSSE.jl Documentation","title":"PowerModelsDSSE.jl Documentation","text":"Frederik Geth (@frederikgeth) CSIRO, General PowerModelsDistribution.jl Advice.\nSander Claeys (@SanderClaeys) KU Leuven, General PowerModelsDistribution.jl Advice.","category":"page"},{"location":"#License","page":"PowerModelsDSSE.jl Documentation","title":"License","text":"","category":"section"},{"location":"","page":"PowerModelsDSSE.jl Documentation","title":"PowerModelsDSSE.jl Documentation","text":"XXX","category":"page"}]
